INSERT INTO `bdr_registry_comment` VALUES (1,'marked as inactive 15/3/2013\r\nFrom: Franck Thiebault [mailto:Franck.Thiebault@cellmark.com] \r\nSent: 27 March 2012 10:52\r\nTo: F-gases Reporting\r\nSubject: RE: F-gases - end of business [Alcan International Network Ltd(UK)]\r\n','2012-12-07 13:44:46',5),(2,'marked as inactive 15/3/2013\nFrom: F-gases Reporting \nSent: 15 March 2013 12:42\nTo: BDR Helpdesk\nSubject: RE: F-Gas reporting: AREVA T&D Europe / France / fgas21146 - Account information\n','2012-12-07 13:44:46',6),(3,'www.maniadis-tairis.gr  doesn\'t exist\n\n2014-2-27: Previous VAT nbr:EL095311414, the client claims it never changed, so I input the one he gave us','2012-12-07 13:44:46',22),(4,'26 Feb 2014\nMr.Georgi Ivanov is actually the owner and GM of the company. That is why I pointed him as a principal contact. ','2012-12-07 13:44:46',27),(5,'From: vfourneau@crealis.dehon.com [mailto:vfourneau@crealis.dehon.com] \nSent: 18 March 2013 21:50\nTo: BDR Helpdesk\nCc: pbedel@inventec.dehon.com; tobannwarth@dehon.com\nSubject: Tr : RE: F-Gas reporting: Galex / France / fgas24826 - Account information\n\n \n\nDear BDT Helpdesk, \n\nplease note that Galex doesn\'t exist anymore \n','2012-12-07 13:44:46',46),(6,'From: F-gases Reporting \nSent: 20 March 2013 16:27\nTo: BDR Helpdesk\nSubject: [Gasco BE fgas24789] FW: F-Gas reporting \n\nHI \nSee mail below referring to Gasco BE fgas24789:\nFrom previous year, we had on one hand the information that GAsco BE is bankrupt.\nI suggest setting them inactive\nBest\nWolfram \n\n\nFrom: Jef Geerts [mailto:jefgeerts@mebrom.com.hk] \nSent: 20 March 2013 11:01\nTo: F-gases Reporting\nSubject: F-Gas reporting\n\nDear Sir,\nI am no longer responsable nor do have any relation with Gasco BE.\nRegards,\nJef Geerts\n','2012-12-07 13:44:46',47),(7,'\nFrom: Walthaus, H.H.J. (Herman) - DGMI [mailto:Herman.Walthaus@minienm.nl] \nSent: 25 April 2013 16:44\nTo: CLIMA-FGAS-REPORTING@ec.europa.eu\nCc: F-gases Reporting; Arno.KASCHL@ec.europa.eu; bos@gasco.nl\nSubject: RE: Missing reports under Article 6 (The Netherlands) [Gasco NL]\n\nAléxandros,\n \n \n \nI’ve checked this. \n \nGasco doesn’t produce or import any F-gasses anymore. Gasco informed you and us about this last year.\n \nGasco has no intention to do any of these activities  in the future. They only distribute within the EU, so there is no obligation for Gasco to report.\nYou can deactivate the Gasco account.\n \n \nI hope this will help you so you can close this dossier.\n \n \nBest regards,\n \n \nHerman Walthaus\nCoordinator non-CO2 Greenhouse gasses\n \nMinistry of Infrastructure and Environment\nDirectorate Climate, Air and Noise | DG Environment and International Affairs\nPlesmanweg 1-6 | P.O. Box 20901 | 2500 EX Den Haag | The Netherlands\nRoom: C 01.15\n','2012-12-07 13:44:46',50),(8,'Ceased trading in Nov 2008 (email from Yvonne Pearce - ypearce@aircongroup.co.uk)','2012-12-07 13:44:46',51),(9,'From: Mark [mailto:mark@gascoireland.com] \nSent: 21 March 2013 14:09\nTo: BDR Helpdesk\nSubject: RE: Reminder - F-Gas reporting for 2012: Gasco Ireland Ltd. / Ireland / fgas20571\n\nTo Whom it may concern.\n\nWe purchase/import all our refrigerant from within the EU so the below is not applicable to us.\n\nPlease note that Gasco Ireland Ltd was taken over by Dean and Wood Ireland Ltd in August 2012.\n','2012-12-07 13:44:46',52),(10,'10-3-2014 - old email address SBaber@harpintl.com changed to  slbaber@harpintl.com','2012-12-07 13:44:46',59),(11,'From: tobannwarth@dehon.com [tobannwarth@dehon.com]\nSent: 20 March 2013 12:54\n\nI confirm that the person who is in charge of  the F-Gas reporting for Inventec Performance Chemicals is Mr Thierry-Olivier BANNWARTH (tobannwarth@dehon.com).\n\n\nMr Patrice ROLLET is General Manager of Inventec Performance Chemicals. \nThen you can keep Patrice ROLLET (pbouchard-mona@inventec.dehon.com) as a contact, but not directly in charge of the reporting.\n','2012-12-07 13:44:46',67),(12,'24/04 Deactivated following email by competent authority in 23 April 2013 (confirmation received by ETC on 23/04).','2012-12-07 13:44:46',74),(13,'24/04/2013: Marked inactive after email received by the company (Harri Laakso) on 23/04/2013','2012-12-07 13:44:46',88),(14,'Password reset 14/03/2013\nPassword reset 18/03/2013  email address  problem on 14/3','2012-12-07 13:44:46',90),(15,'Tel.: +34 918863.099\nFax: +39 918308.641\nhttp://www.tazzetti.com/es-es/contact-us','2012-12-07 13:44:46',119),(16,'From: Irina Sirashka [mailto:sirashka@moew.government.bg] \nSent: 10 April 2013 13:27\nTo: BDR Helpdesk\nSubject: Re: Information on reminders sent out to undertakings - F-Gases reporting for 2012\n\nDear Ms. Goossens,\n\nPlease be informed that the company Tura does not exist since year 2008. \n','2012-12-07 13:44:46',124),(91,'29/04/2013: Set inactive after information received from DG Clima (mail from Alexandros Kyriazis, 25/4/2013) and after confirmation from ETC (ODS Reporting 26/04/2013).\n\n[Testing company]','2013-02-06 15:08:59',471),(93,'Registered 14/03/2013','2013-02-19 10:36:23',474),(95,'Registered 14/03/2013.\r\n','2013-02-26 07:49:30',477),(97,'Registered 14/03/2013','2013-03-06 10:31:11',483),(99,'Appears to be duplicate self registration with different postal code  no action taken','2013-03-11 11:26:22',488),(104,'From: Pauline Cilia [mailto:pauline@blyeeng.com] \nSent: 22 March 2013 14:57\nTo: BDR Helpdesk\nCc: \'Ray Mallia\'\nSubject: RE: BDR Registration\n\n\nDear Sir/Madam,\n\nI hereby confirm that BLYE Co. Ltd. is a separate entity to already registered BLYE Engineering Co. Ltd. \n\nBLYE Co. Ltd. started importing F Gases from this year 2013, so no report for the year 2012 will be sent.\n\nKind regards,\n\nPauline Cilia\nBlye Co. Ltd\nPalm Street,\nPaola, Malta\nTel: (+356) 21373282 / 3 Ext: 131\nDirect: (+356) 21 802886\nFax: (+356) 21 371642\npauline@blyeeng.com\n','2013-03-21 12:39:49',503),(109,'duplicate','2013-03-27 13:23:46',515),(111,'duplicate','2013-04-03 08:07:31',528),(115,'duplicate','2013-05-03 07:35:05',537),(125,'asdadadsada d sadas d\r\nad asds adas dasd asd asd as dasd ','2014-03-18 17:57:48',472),(140,'\r\nTicket#2014032810000157 - EE101160904 different EORI number given','2014-03-31 08:17:43',617),(148,'asdf','2014-04-07 09:39:26',472),(149,'ssss','2014-04-07 10:04:35',472),(150,'xxx','2014-04-07 10:05:21',472),(157,'Deactivated','2014-04-25 11:10:32',632),(158,'Wrong category, he should have registered under ODS Ticket#2014043010000203','2014-05-05 06:40:04',636),(159,'As per Graham\'s email - company made inactive \r\nTicket#2014050610000079','2014-05-06 12:05:55',615),(170,'Ticket#2014052010000051 deactivated ','2014-05-20 08:07:33',477),(173,'Ticket#2014061010000096 - new accounts created manually with missing info.','2014-06-10 07:49:10',648),(174,'Address: Suzuki Motor Corporation 300, Takatsuka-cho, Minami-ku, Hamamatsu-shi,\r\nShizuoka-ken, JAPAN\r\n\r\n','2014-06-10 07:51:59',649),(175,'Ticket#2014061010000096 new acccts created manually - Japan country missing inputed European Union instead.','2014-06-10 07:51:59',649),(176,'Ticket#2014061010000096 new acct entered manually','2014-06-10 08:00:33',650),(177,'Vehicle Environmental Engineering - SE&SE\r\nD-E479/W03\r\n','2014-06-10 08:03:50',648),(178,'Ticket#2014061010000096 new acct created manually , info missing','2014-06-10 08:16:43',651),(179,'Ticket#2014061010000096 new acct created manually, info missing','2014-06-10 08:19:30',652),(180,'Vehicle Environmental Engineering - SE&SE\r\nD-E479/W03\r\n','2014-06-10 09:01:54',652),(181,'Suzuki Motor Corporation 300, Takatsuka-cho, Minami-ku, Hamamatsu-shi,\r\nShizuoka-ken, JAPAN\r\n','2014-06-10 09:03:16',653),(182,'Ticket#2014061010000096 new acct created manually','2014-06-10 09:03:16',653),(183,'Ticket#2014061010000096 new acct created manually, info missing','2014-06-10 09:08:21',655),(184,'Ticket#2014061010000096 new acct created manually','2014-06-10 09:09:35',654),(192,'<p>Re-enabled the comp