onet.europa.eu</a>.\r\n  </p>\r\n\r\n  <p>\r\n    In order to submit your report you will need to login using the\r\n    username and password for your company. The company for which you\r\n    have received reporting rights is <strong>SUZUKI INTERNATIONAL EUORPE GMBH</strong>\r\n    in <strong>European Union</strong>. The username for your\r\n    company is <strong>vans3006</strong> and the password\r\n    is <strong>t3q4t7qa</strong>.\r\n  </p>\r\n\r\n  <p>\r\n    Please note that this password will be valid for reporting during the\r\n    year 2014.  To ensure confidentiality we will reset the password at\r\n    the beginning of 2015.\r\n  </p>\r\n\r\n  <h1>How to submit your report?</h1>\r\n\r\n  <p>\r\n    Detailed information on how to upload your delivery to BDR is\r\n    available in the BDR User Manual at: https://circabc.europa.eu/w/browse/a41f7626-c660-4ee6-9b4b-8f198de8ab5c   </p>\r\n\r\n  <h1>Reporting requirements and forms</h1>\r\n\r\n  <p>\r\n    From this year the EEA is collecting the corrections from cars\r\n    manufacturers using the BDR. When notifying corrections back to the\r\n    Commission, the manufacturer must include all records and all entries that\r\n    are relevant for it; i.e. both those that the manufacturer considers\r\n    correct as well as those that have been corrected.\r\n    For 2014, manufacturers can provide data in several formats:\r\n    .xls, .csv, .xml, .mdb.\r\n  </p>\r\n\r\n  <h1>BDR Helpdesk</h1>\r\n\r\n  <p>\r\n    Please feel free to contact the BDR Helpdesk\r\n    (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):\r\n  </p>\r\n\r\n  <ul>\r\n    <li>\r\n      If you received this e-mail but you think that you are no longer\r\n      subject to the reporting obligations, please be so kind to inform\r\n      us accordingly.\r\n    </li>\r\n\r\n  </ul>\r\n\r\n  <p>Thank you in advance for your co-operation.</p>\r\n\r\n  <p>\r\n    Yours faithfully<br />\r\n    BDR Helpdesk\r\n  </p>\r\n\r\