  webforms can perform certain checks immediately while you are\r\n    completing the form or immediately after submission. This will\r\n    increase the user friendliness and reduce the administrative burden\r\n    for all stakeholders. It will also reduce the number of questions\r\n    posed to you after submission. While the webforms by nature will\r\n    look somewhat different from the Excel sheets used so far, no\r\n    additional data will be requested compared to previous years. Due to\r\n    the functionality of the online forms it was possible to eliminate\r\n    certain tables and to avoid that data needs to be repeated in two\r\n    different forms. For example companies importing ODS and using them\r\n    for feedstock data had to fill in certain data in both forms in the\r\n    past which was an additional source of errors.\r\n  </p>\r\n\r\n  <p>\r\n    Reporting is not required if you solely import or export products or\r\n    equipments containing or relying on ODS (e.g. fire extinguishers or\r\n    aircraft). Reporting is not required if you produce, import or\r\n    export less than one tonne of fluorinated greenhouse gases.\r\n  </p>\r\n\r\n  <h1>BDR Helpdesk</h1>\r\n\r\n  <p>\r\n    Please feel free to contact the BDR Helpdesk\r\n    (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):\r\n  </p>\r\n\r\n  <ul>\r\n    <li>\r\n      if you received this e-mail but you think that you are no longer\r\n      subject to the reporting obligations, please be so kind to inform\r\n      us accordingly.\r\n    </li>\r\n\r\n    <li>\r\n      for technical assistance with access to BDR and the submission\r\n      process.\r\n    </li>\r\n  </ul>\r\n\r\n  <p>Thank you in advance for your co-operation.</p>\r\n\r\n  <p>\r\n    Yours faithfully<br />\r\n    BDR Helpdesk\r\n  </p>\r\n</body>\r\n</html>\r\n',0,3,'2014-07-08 07:24:58','2014-07-08 07:24:58',NULL,NULL,NULL,'\"\"','','',''),(21,'BDR Registration <bdr-registration@eionet.europa