 2015.\r\n  </p>\r\n\r\n  <h1>How to submit your report?</h1>\r\n\r\n  <p>\r\n    Detailed information on how to upload your delivery to BDR is available at: \r\n    <a href=\"https://bdr.eionet.europa.eu/help/upload.html\">bdr.eionet.europa.eu/help/upload.html</a>.\r\n  </p>\r\n\r\n  <h1>Reporting requirements and forms</h1>\r\n\r\n  <p>\r\n    From this year the EEA is using online webforms to collect the data\r\n    you need to submit. This allows amongst others the data to be fed\r\n    directly into a database without the need for manual processing. The\r\n    webforms can perform certain checks immediately while you are\r\n    completing the form or immediately after submission. This will\r\n    increase the user friendliness and reduce the administrative burden\r\n    for all stakeholders. It will also reduce the number of questions\r\n    posed to you after submission. While the webforms by nature will\r\n    look somewhat different from the Excel sheets used so far, no\r\n    additional data will be requested compared to previous years. Due to\r\n    the functionality of the online forms it was possible to eliminate\r\n    certain tables and to avoid that data needs to be repeated in two\r\n    different forms. For example companies importing ODS and using them\r\n    for feedstock data had to fill in certain data in both forms in the\r\n    past which was an additional source of errors.\r\n  </p>\r\n\r\n  <p>\r\n    Reporting is not required if you solely import or export products or\r\n    equipments containing or relying on ODS (e.g. fire extinguishers or\r\n    aircraft). Reporting is not required if you produce, import or\r\n    export less than one tonne of fluorinated greenhouse gases.\r\n  </p>\r\n\r\n  <h1>BDR Helpdesk</h1>\r\n\r\n  <p>\r\n    Please feel free to contact the BDR Helpdesk\r\n    (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):\r\n  </p>\r\n\r\n  <ul>\r\n    <li>\r\n      if you received this e-mail but you think that you are no longer\r\n      subject to the reporting obligations, please be so kind to inform\r\n      us accordingly.\r\n    </li>\r\n\r\n    <li>\r\n      for technical assistance with access to BDR and the submission\r\n      process.\r\n    </li>\r\n  </ul>\r\n\r\n  <p>Thank you in advance for your co-operation.</p>\r\n\r\n  <p>\r\n    Yours faithfully<br />\r\n    BDR Helpdesk\r\n  </p>\r\n</body>\r\n</html>\r\n',0,3,'2014-10-09 08:02:50','2014-10-09 08:02:51',NULL,NULL,NULL,'\"\"','','BDR.Helpdesk@eea.europa.eu, ods.reporting@eea.europa.eu',''),(60,'BDR Registration <bdr-registration@eionet.europa.eu>','sylvie.macaudiere@arkema.com','Reporting data on ODS','','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n  <meta charset=\"utf-8\">\r\n  <title>Reporting data on ODS covering 2014</title>\r\n</head>\r\n\r\n<body>\r\n  <p>Dear  Sylvie Macaudière,</p>\r\n\r\n  <p>\r\n    This message is addressed to you as the contact person of an\r\n    undertaking that needs to report data on Ozone Depleting Substances\r\n    (ODS) under Article 27 of Regulation (EC) No 1005/2009.\r\n  </p>\r\n\r\n  <p>\r\n    The report needs to be submitted to the European Environment Agency\r\n    (EEA) using the online Business Data Repository (BDR) at \r\n    <a href=\"https://bdr.eionet.europa.eu/\">bdr.eionet.europa.eu</a>.\r\n  </p>\r\n\r\n  <p>\r\n    In order to submit your report you will need to login using the\r\n    username and password for your company. The company for which you\r\n    have received reporting rights is <b>Arkema Quimica SA</b> in\r\n    <b>Spain</b>. The username for your\r\n    company is <b>ods30053</b> and the password\r\n    is <b>1fl6vw9w</b>.\r\n  </p>\r\n\r\n  <p>\r\n    Please note that this password will be valid for reporting during the\r\n    year 2014. To assure confidentiality we will reset the password at\r\n    the beginning of 2015.\r\n  </p>\r\n\r\n  <h1>How to submit your report?</h1>\r\n\r\n  <p>\r\n    Detailed information on how to up