to:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul><li>If you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li><li>For technical assistance with access to BDR and the submission process.</li></ul><p>Thank you in advance for your co-operation.</p><p>Yours faithfully,</p><p>BDR Helpdesk</p>',0,3,'2016-02-15 10:19:20','2016-02-15 10:19:20',NULL,NULL,NULL,'\"\"','','BDR.Helpdesk@eea.europa.eu, ods.reporting@eea.europa.eu',''),(71,'bdr-test-registration@eionet.europa.eu','olimpiu.rob@eaudeweb.ro, ibolya.bunda@eea.europa.eu, ods@eea.europa.eu, ods.reporting@eea.europa.eu, BDR.helpdesk@eea.europa.eu','New company registered','','<h1>BDR Registration</h1><p>Company: [test] 123 company</p><p>Obligation: Ozone depleting substances</p><p>Street and nr: [test] 123 street</p><p>Place 1 / Municipality: [test] 123 city</p><p>Postal code: 123</p><p>Place 2 / Region: </p><p>Country: Romania</p><p>First contact:</p><p>Title: </p><p>Family name: Nitu</p><p>First name: Cornel</p><p>Email address: cornel.nitu@eaudeweb.ro</p><p>Telephone: 0721223623</p><p>Fax: </p><p><em>Best regards<br />BDR</em></p>',0,3,'2016-02-16 15:09:52','2016-02-16 15:09:52',NULL,NULL,NULL,'\"\"','','',''),(72,'bdr-test-registration@eionet.europa.eu','cornel.nitu@eaudeweb.ro','Reporting data on ODS','','<h1>Reporting data on ODS covering 2015</h1><p>Dear  Cornel Nitu,</p><p>This message is addressed to you as the contact person of an undertaking that needs to report data on Ozone Depleting Substances (ODS) under Article 27 of Regulation (EC) No 1005/2009.</p><p>The report needs to be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at <a href=\"https://bdr.eionet.europa.eu\">bdr.eionet.europa.eu</a>.</p><p>In order to submit your report you will need to login using the username and password for your company. The company for which you have received re