europa.eu','olimpiu.rob@eaudeweb.ro, ibolya.bunda@eea.europa.eu, ods@eea.europa.eu, ods.reporting@eea.europa.eu, BDR.helpdesk@eea.europa.eu','New company registered','','<h1>BDR Registration</h1><p>Company: Testing 22022016</p><p>Obligation: Ozone depleting substances</p><p>Street and nr: Kongens Nytorv</p><p>Place 1 / Municipality: Copenhagen</p><p>Postal code: 1050</p><p>Place 2 / Region: </p><p>Country: Denmark</p><p>First contact:</p><p>Title: </p><p>Family name: Bunda</p><p>First name: Ibolya</p><p>Email address: ibolya.bunda@eea.europa.eu</p><p>Telephone: 123456</p><p>Fax: </p><p><em>Best regards<br />BDR</em></p>',0,3,'2016-02-22 09:50:49','2016-02-22 09:50:49',NULL,NULL,NULL,'\"\"','','',''),(74,'bdr-test-registration@eionet.europa.eu','ibolya.bunda@eea.europa.eu','Reporting data on ODS','','<h1>Reporting data on ODS covering 2015</h1><p>Dear  Ibolya Bunda,</p><p>This message is addressed to you as the contact person of an undertaking that needs to report data on Ozone Depleting Substances (ODS) under Article 27 of Regulation (EC) No 1005/2009.</p><p>The report needs to be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at <a href=\"https://bdr.eionet.europa.eu\">bdr.eionet.europa.eu</a>.</p><p>In order to submit your report you will need to login using the username and password for your company. The company for which you have received reporting rights is Testing 22022016 in Denmark. The username for your company is ods30063 and the password is ohd8jnvc.</p><p>Please note that this password will be valid for reporting during the year 2016. To assure confidentiality we will reset the password at the beginning of 2017.</p><h2>How to submit your report?</h2><p>Detailed information on how to upload your delivery to BDR is available at: <a href=\"https://bdr.eionet.europa.eu/help/ods\">https://bdr.eionet.europa.eu/help/ods</a>.</p><h2>Reporting requirements and forms</h2><p>The EEA is using online webforms to collect the data you need to submit. This allows amongst others the data to be fed directly into a database without the need for manual processing. The webforms can perform certain checks immediately while you are completing the form or immediately after submission. This will increase the user friendliness and reduce the administrative burden for all stakeholders. It will also reduce the number of questions posed to you after submission.&nbsp;</p><p>For assistance during reporting, please consider the two different guidance documents that can be accessed under the following link: <a href=\"https://bdr.eionet.europa.eu/help/ods\">https://bdr.eionet.europa.eu/help/ods</a>&nbsp;</p><ul><li>ODS BDR User Manual</li><li>Frequently Asked Questions</li></ul><h2>BDR Helpdesk</h2><p>Please feel free to contact the BDR Helpdesk (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul><li>If you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li><li>For technical assistance with access to BDR and the submission process.</li></ul><p>Thank you in advance for your co-operation.</p><p>Yours faithfully,</p><p>BDR Helpdesk</p>',0,3,'2016-02-22 09:51:41','2016-02-22 09:51:41',NULL,NULL,NULL,'\"\"','','BDR.Helpdesk@eea.europa.eu, ods.reporting@eea.europa.eu',''),(75,'bdr-test-registration@eionet.europa.eu','cornel.nitu@eaudeweb.ro','Reporting data on ODS','','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n  <meta charset=\"utf-8\">\r\n  <title>Reporting data on ODS covering 2014</title>\r\n</head>\r\n\r\n<body>\r\n  <p>Dear  test test,</p>\r\n\r\n  <p>\r\n    This message is addressed to you as the contact person of an\r\n    undertaking that needs to report data on Ozone Depleting Substances\r\n    (ODS) under Article 27 of Regulation (EC) No 1005/2009.\r\n  </p>\r\n\r\n  <p>\r\n    The report needs to be submitted to the European Environment Agency\r\n    (EEA) using the online Business Data Repository (BDR) at \r\n    <a href=\"https://bdr.eionet.europa.eu/\">bdr.eionet.europa.eu</a>.\r\n  </p>\r\n\r\n  <p>\r\n    In order to submit your report you will need to login using the\r\n    username and password for your company. The company for which you\r\n    have received reporting rights is <b>test prefix company</b> in\r\n    <b>Austria</b>. The username for your\r\n    company is <b>test.ods30064</b> and the password\r\n    is <b>w2lz1p17</b>.\r\n  </p>\r\n\r\n  <p>\r\n    Please note that this password will be valid for reporting during the\r\n    year 2014. To assure confidentiality we will reset the password at\r\n    the beginning of 2015.\r\n  </p>\r\n\r\n  <h1>How to submit your report?</h1>\r\n\r\n  <p>\r\n    Detailed information on how to upload your delivery to BDR is available at: \r\n    <a href=\"https://bdr.eionet.europa.eu/help/upload.html\">bdr.eionet.europa.eu/help/upload.html</a>.\r\n  </p>\r\n\r\n  <h1>Reporting requirements and forms</h1>\r\n\r\n  <p>\r\n    From this year the EEA is using online webforms to collect the data\r\n    you need to submit. This allows amongst others the data to be fed\r\n    directly into a database without the need for manual processing. The\r\n    webforms can perform certain checks immediately while you are\r\n    completing the form or immediately after submission. This will\r\n    increase the user friendliness and reduce the administrative burden\r\n    for all stakeholders. It will also reduce the number of questions\r\n    posed to you after submission. While the webforms by nature will\r\n    look somewhat different from the Excel sheets used so far, no\r\n    additional data will be requested compared to previous years. Due to\r\n    the functionality of the online forms it was possible to eliminate\r\n    certain tables and to avoid that data needs to be repeated in two\r\n    different forms. For example companies importing ODS and using them\r\n    for feedstock data had to fill in certain data in both forms in the\r\n    past which was an additional source of errors.\r\n  </p>\r\n\r\n  <p>\r\n    Reporting is not required if you solely import or export products or\r\n    equipments containing or relying on ODS (e.g. fire extinguishers or\r\n    aircraft). Reporting is not required if you produce, import or\r\n    export less than one tonne of fluorinated greenhouse gases.\r\n  </p>\r\n\r\n  <h1>BDR Helpdesk</h1>\r\n\r\n  <p>\r\n    Please feel free to contact the BDR Helpdesk\r\n    (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):\r\n  </p>\r\n\r\n  <ul>\r\n    <li>\r\n      if you received this e-mail but you think that you are no longer\r\n      subject to the reporting obligations, please be so kind to inform\r\n      us accordingly.\r\n    </li>\r\n\r\n    <li>\r\n      for technical assistance with access to BDR and the submission\r\n      process.\r\n    </li>\r\n  </ul>\r\n\r\n  <p>Thank you in advance for your co-operation.</p>\r\n\r\n  <p>\r\n    Yours faithfully<br />\r\n    BDR Helpdesk\r\n  </p>\r\n</body>\r\n</html>\r\n',0,3,'2016-02-26 15:51:05','2016-02-26 15:51:05',NULL,NULL,NULL,'\"\"','','',''),(76,'bdr-test-registration@eionet.europa.eu','miruna@eaudeweb.ro','Reporting data on ODS','','<h1>Reporting data on ODS covering 2015</h1><p style=\"line-height: 20.8px;\">Dear  q q,</p><p style=\"line-height: 20.8px;\">This message is addressed to you as the contact person of an undertaking that needs to report data on Ozone Depleting Substances (ODS) under Article 27 of Regulation (EC) No 1005/2009.</p><p style=\"line-height: 20.8px;\">The report needs to be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at&nbsp;<a href=\"https://bdr.eionet.europa.eu\">bdr.eionet.europa.eu</a>.</p><p style=\"line-height: 20.8px;\">In order to submit your report you will need to login using the username and password for your company. The company for which you have received reporting rights is test miruna in Austria. The username for your company is test.ods30065 and the password is i3ipo0mp.</p><p style=\"line-height: 20.8px;\">Please note that this password will be valid for reporting during the year 2016. To assure confidentiality we will reset the password at the beginning of 2017.</p><h2>How to submit your report?</h2><p style=\"line-height: 20.8px;\">Detailed information on how to upload your delivery to BDR is available at:&nbsp;<a href=\"https://bdr.eionet.europa.eu/help/ods\">https://bdr.eionet.europa.eu/help/ods</a>.</p><h2>Reporting requirements and forms</h2><p style=\"line-height: 20.8px;\">The EEA is using online webforms to collect the data you need to submit. This allows amongst others the data to be fed directly into a database without the need for manual processing. The webforms can perform certain checks immediately while you are completing the form or immediately after submission. This will increase the user friendliness and reduce the administrative burden for all stakeholders. It will also reduce the number of questions posed to you after submission.&nbsp;</p><p style=\"line-height: 20.8px;\">For assistance during reporting, please consider the two different guidance documents that can be accessed under the following link:&nbsp;<a href=\"https://bdr.eionet.europa.eu/help/ods\">https://bdr.eionet.europa.eu/help/ods</a>&nbsp;</p><ul style=\"line-height: 20.8px;\"><li>ODS BDR User Manual</li><li>Frequently Asked Questions</li></ul><h2>BDR Helpdesk</h2><p style=\"line-height: 20.8px;\">Please feel free to contact the BDR Helpdesk (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul style=\"line-height: 20.8px;\"><li>If you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li><li>For technical assistance with access to BDR and the submission process.</li></ul><p style=\"line-height: 20.8px;\">Thank you in advance for your co-operation.</p><p style=\"line-height: 20.8px;\">Yours faithfully,</p><p style=\"line-height: 20.8px;\">BDR Helpdesk</p>',0,3,'2016-03-01 12:20:28','2016-03-01 12:20:28',NULL,NULL,NULL,'\"\"','','',''),(77,'bdr-test-registration@eionet.europa.eu','olimpiu.rob@eaudeweb.ro, ibolya.bunda@eea.europa.eu, ods@eea.europa.eu, ods.reporting@eea.europa.eu, BDR.helpdesk@eea.europa.eu, bogdan.ciobanu@eaudeweb.ro, fh@oekorecherche.de','New company registered','','<h1>BDR Registration</h1><p>Company: Test</p><p>Obligation: Ozone depleting substances</p><p>Street and nr: Test Street</p><p>Place 1 / Municipality: Test municipality</p><p>Postal code: 410397</p><p>Place 2 / Region: </p><p>Country: Romania</p><p>First contact:</p><p>Title: </p><p>Family name: Test name</p><p>First name: Test firstname</p><p>Email address: olimpiu.rob@gmail.com</p><p>Telephone: 0740000050</p><p>Fax: </p><p><em>Best regards<br />BDR</em></p>',0,3,'2017-08-01 10:29:12','2017-08-01 10:29:12',NULL,NULL,NULL,NULL,'','','');
