INSERT INTO `post_office_emailtemplate` VALUES (1,'ODS','Reporting data on ODS','','<h1>Reporting data on ODS covering {{ reporting_year }}</h1><p style=\"line-height: 20.8px;\">Dear {{ person.formal_name }},</p><p style=\"line-height: 20.8px;\">This message is addressed to you as the contact person of an undertaking that needs to report data on Ozone Depleting Substances (ODS) under Article 27 of Regulation (EC) No 1005/2009.</p><p style=\"line-height: 20.8px;\">The report needs to be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at&nbsp;<a href=\"https://bdr.eionet.europa.eu\">bdr.eionet.europa.eu</a>.</p><p style=\"line-height: 20.8px;\">In order to submit your report you will need to login using the username and password for your company. The company for which you have received reporting rights is {{ company.name }} in {{ company.country.name }}. The username for your company is {{ company.account.uid }} and the password is {{ company.account.password }}.</p><p style=\"line-height: 20.8px;\">Please note that this password will be valid for reporting during the year {{ reporting_year|add:\"1\" }}. To assure confidentiality we will reset the password at the beginning of {{ next_year|add:\"1\" }}.</p><h2>How to submit your report?</h2><p style=\"line-height: 20.8px;\">Detailed information on how to upload your delivery to BDR is available at:&nbsp;<a href=\"https://bdr.eionet.europa.eu/help/ods\">https://bdr.eionet.europa.eu/help/ods</a>.</p><h2>Reporting requirements and forms</h2><p style=\"line-height: 20.8px;\">The EEA is using online webforms to collect the data you need to submit. This allows amongst others the data to be fed directly into a database without the need for manual processing. The webforms can perform certain checks immediately while you are completing the form or immediately after submission. This will increase the user friendliness and reduce the administrative burden for all stakeholders. It will also reduce the number of questions posed to you after submission.&nbsp;</p><p style=\"line-height: 20.8px;\">For assistance during reporting, please consider the two different guidance documents that can be accessed under the following link:&nbsp;<a href=\"https://bdr.eionet.europa.eu/help/ods\">https://bdr.eionet.europa.eu/help/ods</a>&nbsp;</p><ul style=\"line-height: 20.8px;\"><li>ODS BDR User Manual</li><li>Frequently Asked Questions</li></ul><h2>BDR Helpdesk</h2><p style=\"line-height: 20.8px;\">Please feel free to contact the BDR Helpdesk (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul style=\"line-height: 20.8px;\"><li>If you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li><li>For technical assistance with access to BDR and the submission process.</li></ul><p style=\"line-height: 20.8px;\">Thank you in advance for your co-operation.</p><p style=\"line-height: 20.8px;\">Yours faithfully,</p><p style=\"line-height: 20.8px;\">BDR Helpdesk</p>','2014-05-13 14:49:55','2016-03-01 06:42:06','',NULL,''),(2,'F-Gases','Reporting data on F-Gases','','<p><span style=\"line-height:20.8px\">Reporting data on F-Gases covering {{ reporting_year }}</span></p><p style=\"line-height: 20.8px;\">Dear {{ person.formal_name }},</p><p style=\"line-height: 20.8px;\">This message is addressed to you as the contact person of an undertaking that needs to report data on fluorinated greenhouse gases (F-Gases) under Article 6 of Regulation (EC) No 842/2006.</p><p style=\"line-height: 20.8px;\">The report needs to be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at&nbsp;<a href=\"https://bdr.eionet.europa.eu/\">bdr.eionet.europa.eu</a>.</p><p style=\"line-height: 20.8px;\">In order to submit your report you will need to login using the username and password for your company. The company for which you have received reporting rights is&nbsp;<strong>{{ company.name }}</strong>&nbsp;in&nbsp;<strong>{{ company.country.name }}</strong>. The username for your company is:&nbsp;<strong>{{ company.account.uid }}</strong>&nbsp;and the password is&nbsp;<strong>{{ company.account.password }}</strong>.</p><p style=\"line-height: 20.8px;\">Please note that this password will be valid for reporting during the year {{ reporting_year }}. To assure confidentiality we will reset the password at the beginning of {{ next_year }}.</p><h1>How to submit your report?</h1><p style=\"line-height: 20.8px;\">Detailed information on how to upload your delivery to BDR is available at:&nbsp;<a href=\"https://bdr.eionet.europa.eu/help/upload.html\">bdr.eionet.europa.eu/help/upload.html</a>.</p><h1>Reporting requirements and forms</h1><p style=\"line-height: 20.8px;\">From this year the EEA is using online webforms to collect the data you need to submit. This allows amongst others the data to be fed directly into a database without the need for manual processing. The webforms can perform certain checks immediately while you are completing the form or immediately after submission. This will increase the user friendliness and reduce the administrative burden for all stakeholders. It will also reduce the number of questions posed to you after submission. While the webforms by nature will look somewhat different from the Excel sheets used so far, no additional data will be requested compared to previous years. Due to the functionality of the online forms it was possible to eliminate certain tables and to avoid that data needs to be repeated in two different forms.</p><p style=\"line-height: 20.8px;\">Reporting is not required if you produce, import or export less than one tonne of fluorinated greenhouse gases.</p><h1>BDR Helpdesk</h1><p style=\"line-height: 20.8px;\">Please feel free to contact the BDR Helpdesk (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul style=\"line-height: 20.8px;\"><li>if you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li><li>for technical assistance with access to BDR and the submission process.</li></ul><p style=\"line-height: 20.8px;\">Thank you in advance for your co-operation.</p><p style=\"line-height: 20.8px;\">Yours faithfully<br />BDR Helpdesk</p>','2014-05-13 14:49:55','2016-03-01 06:42:18','',NULL,''),(3,'cars','Reporting data on cars','','<p>Reporting data on CARS</p><p>Dear {{ person.formal_name }},</p><p>This message is addressed to you as the contact person of a manufacturer reporting data concerning CO2 emissions from passenger cars in accordance with Article 8(5) of Regulation (EU) No 443/2009.</p><p>The report shall be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at <a href=\"https://bdr.eionet.europa.eu/\">bdr.eionet.europa.eu</a>.</p><p>In order to submit your report you will need to login using the username and password for your company. The company for which you have received reporting rights is <strong>{{ company.name }}</strong> in <strong>{{ company.country.name }}</strong>. The username for your company is <strong>{{ company.account.uid }}</strong> and the password is <strong>{{ company.account.password }}</strong>.</p><p>Please note that this password will be valid for reporting during the year {{ reporting_year }}. To ensure confidentiality we will reset the password at the beginning of {{ next_year }}.</p><h1>How to submit your report?</h1><p>Detailed information on how to upload your delivery to BDR is available in the BDR User Manual at: https://circabc.europa.eu/w/browse/a41f7626-c660-4ee6-9b4b-8f198de8ab5c</p><h1>Reporting requirements and forms</h1><p>From this year the EEA is collecting the corrections from cars manufacturers using the BDR. When notifying corrections back to the Commission, the manufacturer must include all records and all entries that are relevant for it; i.e. both those that the manufacturer considers correct as well as those that have been corrected. For {{ reporting_year }}, manufacturers can provide data in several formats: .xls, .csv, .xml, .mdb.</p><h1>BDR Helpdesk</h1><p>Please feel free to contact the BDR Helpdesk (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul><li>If you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li></ul><p>Thank you in advance for your co-operation.</p><p>Yours faithfully<br />BDR Helpdesk</p>','2014-05-13 14:49:55','2017-02-03 09:58:26','',NULL,''),(4,'vans','Reporting data on vans','','<p>Reporting data on VANS</p><p>Dear {{ person.formal_name }},</p><p>This message is addressed to you as the contact person of a manufacturer reporting data concerning CO2 emissions from vans in accordance with Article 8(5) of Regulation (EU) No 510/2011.</p><p>The report shall be submitted to the European Environment Agency (EEA) using the online Business Data Repository (BDR) at <a href=\"https://bdr.eionet.europa.eu/\">bdr.eionet.europa.eu</a>.</p><p>In order to submit your report you will need to login using the username and password for your company. The company for which you have received reporting rights is <strong>{{ company.name }}</strong> in <strong>{{ company.country.name }}</strong>. The username for your company is <strong>{{ company.account.uid }}</strong> and the password is <strong>{{ company.account.password }}</strong>.</p><p>Please note that this password will be valid for reporting during the year {{ reporting_year }}. To ensure confidentiality we will reset the password at the beginning of {{ next_year }}.</p><h1>How to submit your report?</h1><p>Detailed information on how to upload your delivery to BDR is available in the BDR User Manual at: https://circabc.europa.eu/w/browse/a41f7626-c660-4ee6-9b4b-8f198de8ab5c</p><h1>Reporting requirements and forms</h1><p>From this year the EEA is collecting the corrections from cars manufacturers using the BDR. When notifying corrections back to the Commission, the manufacturer must include all records and all entries that are relevant for it; i.e. both those that the manufacturer considers correct as well as those that have been corrected. For {{ reporting_year }}, manufacturers can provide data in several formats: .xls, .csv, .xml, .mdb.</p><h1>BDR Helpdesk</h1><p>Please feel free to contact the BDR Helpdesk (<a href=\"mailto:BDR.helpdesk@eea.europa.eu\">BDR.helpdesk@eea.europa.eu</a>):</p><ul><li>If you received this e-mail but you think that you are no longer subject to the reporting obligations, please be so kind to inform us accordingly.</li></ul><p>Thank you in advance for your co-operation.</p><p>Yours faithfully<br />BDR Helpdesk</p>','2014-05-13 14:49:55','2017-02-03 09:58:38','',NULL,''),(5,'Self Register','New company registered','','<h1>BDR Registration</h1><p>Company: {{ company.name }}</p><p>Obligation: {{ company.obligation.name }}</p><p>Street and nr: {{ company.addr_street }}</p><p>Place 1 / Municipality: {{ company.addr_place1 }}</p><p>Postal code: {{ company.addr_postalcode }}</p><p>Place 2 / Region: {{ company.addr_place2 }}</p><p>Country: {{ company.country.name }}</p><p>First contact:</p><p>Title: {{ person.title }}</p><p>Family name: {{ person.family_name }}</p><p>First name: {{ person.first_name }}</p><p>Email address: {{ person.email }}</p><p>Telephone: {{ person.phone }}</p><p>Fax: {{ person.fax }}</p><p><em>Best regards<br />BDR</em></p>','2014-06-03 13:04:48','2014-06-03 13:30:00','',NULL,'');
